import React, { Component } from "react";
import "./App.css";
import UserForm from "./components/UserForm";
import MuiThemeProvider from "material-ui/styles/MuiThemeProvider";

class App extends Component {
  render() {
    return (
      <MuiThemeProvider>
        <UserForm />
      </MuiThemeProvider>
    );
  }
}

export default App;
